private int binarySearch(WritableComparable key) {
  int low = 0;
  int high = count-1;

  while (low <= high) {
    int mid = (low + high) >>> 1;
    WritableComparable midVal = keys[mid];
    int cmp = comparator.compare(midVal, key);

    if (cmp < 0)
      low = mid + 1;
    else if (cmp > 0)
      high = mid - 1;
    else
      return mid;                             // key found
  }
  return -(low + 1);                          // key not found.
}

